import requestsfrom bs4 import BeautifulSoupfrom Classes.store import BaseStore, Soupfrom utillities import get_article_from_title, clean_priceclass WoStore(BaseStore):    def __init__(self):        super().__init__(shop_url='https://wo.ua/ua/graficheskie-planshety/brend-is-wacom/')        self.soup = self.get_soup('https://setevuha.com.ua/ru/brands/wacom/')        self.all_items = self.soup.find(class_='CatalogProducts__products')    def get_soup(self, url):        response = requests.get(url)        response.raise_for_status()        return BeautifulSoup(response.text, 'lxml')    def generate_info(self):        for item in self.all_items.find_all('div', class_='ProductItem'):            price_element = item.find_next(class_='ProductItem__bottom-price-new')            name = item.find(class_='ProductItem__name').text            article = get_article_from_title(name)            if price_element is not None:                price = price_element['data-price'].strip().replace('.00', '')                # if 'Немає в наявності' not in status:                card_item = {                    'name': name,                    'price': clean_price(price),                    'article': article                }                self.item_list.append(card_item)            return self.item_list